I did some test by adding Log.Debug everywhere (I am not a good C# dev) and endup notice that the errors only display when the `Synthesis Helper` is disabled;

<img width="378" height="155" alt="Image" src="https://github.com/user-attachments/assets/3bf711dd-9c01-433d-92bc-a9878f969cef" />

I track down the errors calls upto this method ;
https://github.com/Mystic-W/CraftimizerTest/blob/29b045a4ef6f58201e54894dbeb83f2f001b76dc/Craftimizer/Windows/SynthHelper.cs#L529-L535

I suppose when the Synthesis helper is disabled this is still somewhere in the memory so a simple guard close do the trick;

```C#
    private void OnUseAction(ActionType action)
    {
        if (!Service.Configuration.EnableSynthHelper)
            return;

        var addonPtr = Service.GameGui.GetAddonByName("Synthesis");

        if (addonPtr.IsNull)
            return;
```

I was able to use the plugin for the last 15 minutes without any errors
